import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set mobile viewport to trigger mobile menu
    await page.setViewportSize({ width: 375, height: 812 });

    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the mobile menu button
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to appear and take screenshot
    await page.waitForSelector('#mobileMenuOverlay', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Click on a category in the mobile menu
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for navigation and take screenshot
    await page.waitForTimeout(1000); // Brief pause for navigation effect
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_navigation.png'));

    // Extract data to verify navigation worked
    const electronicsProducts = await page.$$eval('.product-card', cards => cards.length);

    return {
      success: true,
      action: "Tested mobile menu navigation by opening menu and selecting Electronics category",
      extractedData: {
        electronicsProductsCount: electronicsProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
